             <p style=""text-align:justify;"">শিক্ষার গুনগত মানোন্নয়নের লক্ষ্যে ইতোমধ্যে সরকার নির্ধারিত সংখ্যক শিক্ষককে বিভিন্ন বিষয়ে প্রশিক্ষণ প্রদানসহ দেশের সকল শিক্ষা প্রতিষ্ঠানের (স্কুল,কলেজ ও মাদরাসা)প্রতিটি শ্রেণীকক্ষ ল্যাপটপসহ মাল্টিমিডিয়া ক্লাসরুমে রুপান্তরের প্রয়োজনীয় পদক্ষেপ গ্রহণ করেছে। তারই ধারাবাহিকতায় উপজেলা পর্যায়ে ওঈঞ এর বিকাশ,উন্নয়ন এবং ডিজিটাল বাংলাদেশ গড়ার লক্ষ্যে সরকার উপজেলা মাধ্যমিক শিক্ষা অফিসারকে উক্ত কমিটির সদস্য সচিবের দায়িত্ব প্রদান করেছেন। তথ্য-প্রযুক্তির মাধ্যমে উপজেলা মাধ্যমিক শিক্ষা অফিস ও এই অফিসের আওতাধীন বিভিন্ন শিক্ষা প্রতিষ্ঠানের সংক্ষিপ্ত বর্ণনা,প্রতিষ্ঠাকাল,ছাত্র-ছাত্রীদের তথ্য,শিক্ষক-শিক্ষিকার তথ্য,প্রতিষ্ঠান পরিচালনা কমিটির তথ্য,বিগত ৫ বছরের সমাপনি ও পাবলিক প");
